import './App.css';
import {BrowserRouter as Router,Route,Routes,Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <div className='Header'>
          <h1> Mountains and Rivers </h1>
          <nav>
            <Link to = "/mountains">Mountains</Link>
            <Link to = "/rivers">Rivers</Link>
          </nav>
        </div>
    </div>
  );
}

export default App;
